import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { AppRouter } from "./AppRouter";

function App() {
  return (
    <div className="App">
      <AppRouter />
      <nav class="navbar navbar-light bg-light">
        <a class="navbar-brand mb-0 h1" href="http://localhost:3000/search">
          Search
        </a>
      </nav>
    </div>
  );
}

export default App;
